    [],nt"revision_timestamp": "2013-03-15T11:48:18.588972",nt"name": "accuracy-assessment-points-for-fort-laramie-national-historic-site-vegetation-mapping-project",nt"isopen":
    false,nt"url": null,nt"notes": "The accuracy assessment field work was
    performed in August and September, 1998 to verify the accuracy of the vegetation
    communities spatial data developed by the USGS-NPS Vegetation Mapping Program for
    Fort Laramie National Historic Site. The data points were randomly distributed stratified
    according to vegetation association over the project area according to protocols
    developed by the Program. Points were located by GPS navigation and the community
    information was collected at the point, without knowledge of the attributes of the
    vegetation spatial data. The data points were compared to the attributes of the
    polygon in which they were contained. Attributes of the polygons or accuracy assessment
    points that did not match were changed during later analysis due to errors in the
    AA methodology or map attribution errors. A contingency table was completed from
    the final dataset.",nt"license_title": null,nt"extras": [{ntt"key":
